import React from "react";
import logo from "../logo.svg";
const Iterms = (props) => {
  return (
    <div>
      <h2>{props.details.name}</h2>
      <h2>{props.details.price}</h2>
      <img src={logo} alt="pic" />
    </div>
  );
};

export default Iterms;
